%kryo-spark
import org.apache.spark.mllib.evaluation.BinaryClassificationMetrics

def eval[T <: Model[T]](model: T, threshold: Double, test: Dataset[_]): Tuple4[Double, Double, Double, Double] = {
    val transformed = model.transform(test).rdd.map(r => (r.getAs[org.apache.spark.ml.linalg.DenseVector]("probability")(1), r.getAs[Double]("manualLabel")))

    val metrics = new BinaryClassificationMetrics(transformed, 1000)

    def findClosest(a: Tuple2[Double, Double], b: Tuple2[Double, Double], threshold: Double): Tuple2[Double, Double] = {
        def dist(t: Tuple2[Double, Double], d: Double): Double = Math.abs(t._1 - d)
        if (dist(a, threshold) < dist(b, threshold)) a else b
    }

    val precision = metrics.precisionByThreshold.reduce(findClosest(_, _, threshold))._2
    val recall = metrics.recallByThreshold.reduce(findClosest(_, _, threshold))._2

    (metrics.areaUnderPR, threshold, precision, recall)
}

%kryo-spark
import java.sql.Timestamp
import org.apache.spark.sql.Dataset
import org.apache.spark.ml.linalg.Vectors

case class Scaled(host: String, procs: String, ts: java.sql.Timestamp, manualLabel: Double, scaledFeatures: org.apache.spark.ml.linalg.Vector)

def normalizeTo(minutes: Int, ts: Timestamp, offset: Int): Timestamp = {
    new Timestamp(((ts.getTime - offset * 60 * 1000) / (60 * 1000 * minutes)) * (60 * 1000 * minutes))
}

def scaleTimeWindowOffset(minutes: Int, original: Dataset[_], offset: Int): Dataset[Scaled] = {
    if (offset >= minutes) {
        throw new IllegalArgumentException("Offset must be smaller than window! Window: " + minutes + ", offset: " + offset)
    }
    original.toDF
        .groupByKey(r => (r.getAs[String]("host"), r.getAs[String]("procs"), normalizeTo(minutes, r.getAs[Timestamp]("ts"), offset)))
        .flatMapGroups((k, vs) => {
            val vsList = vs.toList

            if (vsList.size != minutes) {
                Iterator()
            } else {
                val label = if (vsList.map(_.getAs[Double]("manualLabel")).reduce(_ + _) > (vsList.size.toDouble / 2.0)) 1.0 else 0.0

                val average = Vectors.dense(vsList.map(_.getAs[org.apache.spark.ml.linalg.Vector]("scaledFeatures").toArray).reduce(_.zip(_).map(t => t._1 + t._2)).map(_.toDouble / minutes))

                Iterator(Scaled(k._1, k._2, k._3, label, average))
            }
        })
}

def scaleTimeWindow(minutes: Int, original: Dataset[_]): Dataset[Scaled] = {
    (0 until minutes).map(scaleTimeWindowOffset(minutes, original, _)).reduce(_.union(_)).coalesce(200)
}
